CREATE TABLE `vendas` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `forma_pagamento` text,
  `total_venda` decimal(5,2) DEFAULT NULL,
  `criada_em` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=107 DEFAULT CHARSET=latin1;

CREATE TABLE `roupas` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nome` text,
  `qtd` int(11) DEFAULT NULL,
  `valor_compra` decimal(5,2) DEFAULT NULL,
  `valor_venda` decimal(5,2) DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `vendido` tinyint(1) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=464 DEFAULT CHARSET=latin1;

ALTER TABLE `roupas`
ADD COLUMN `imagem_base64` LONGTEXT NULL AFTER `valor_venda`;

ALTER TABLE `roupas` 
ADD COLUMN `extensao` VARCHAR(10) NULL AFTER `imagem_base64`;

CREATE TABLE `venda_produto` (
  `id_venda` int(11) NOT NULL,
  `id_produto` int(11) NOT NULL,
  `qtd_produto` int(11) DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  KEY `venda__fk` (`id_venda`),
  KEY `produto__fk` (`id_produto`),
  CONSTRAINT `produto__fk` FOREIGN KEY (`id_produto`) REFERENCES `roupas` (`id`),
  CONSTRAINT `venda__fk` FOREIGN KEY (`id_venda`) REFERENCES `vendas` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

